 void solve(){
  int n,counter=0;
  cin>>n;
  string s;
  cin>>s;
  if(n==1){
    cout<<0<<"\n"<<s<<"\n";
    return;
  }
  if(n==2){
    if(s[0]==s[1]){
      cout<<1<<"\n"<<s[0];
      if(s[0]=='R'){
        cout<<"G"<<"\n";
      }else if(s[0]=='G'){
        cout<<"B"<<"\n";
      }else if(s[0]=='B'){
        cout<<"R"<<"\n";
      }
    }else if(s[0]!=s[1]){
      cout<<0<<"\n"<<s<<"\n";
    }
    return;
  }
  string t="RGB";
  sort(all(t));
  map<int,string>mp;
  string ss=s;
  while(next_permutation(t.begin(),t.end())){
    for(int i=0;i<n;i+=3){
      if(s[i]!=t[0]){
        ss[i]=t[0];
        counter++;
      }
      if(s[i+1]!=t[1]&&i+1<n-1){
        ss[i+1]=t[1];
        counter++;
      }
      if(s[i+2]!=t[2]&&i+2<n){
        ss[i+2]=t[2];
        counter++;
      }
    }
    mp[counter]=ss;
    ss=s;
    counter=0;
  }
  for(auto &i:mp){
    cout<<i.first<<"\n"<<i.second<<"\n";
    return;
  }
 }

