class Solution{
public:	
	// Function returns the second
	// largest elements
	int print2largest(int arr[], int n) {
	    // code here
	    sort(arr,arr+n);
	    set<int> s;
	    
	    for(int i=n-1;i>=0;i--)
	    {
	        s.insert(arr[i]);
	    }
	    int j=1;
	    for (auto i : s)
	    {
	       if(j==s.size()-1)
	       {
	            return i;
	       }
	       j++;
	       
	    }
	    return -1;
	}
};

