const int N{ 6 };

void wprowadz_liczby(int* tab) {
	cout << "Wprowadz " << N << " liczb: ";
	for (int i = 0; i < N; ++i) {
		cin >> tab[i];
	}
}

void sortuj(int* tab) {
	for (int i = 0; i < N - 1; ++i) {
		for (int j = 0; j < N - 1 - i; ++j) {
			if (tab[j] < tab[j + 1]) {
				swap(tab[j], tab[j + 1]);
			}
		}
	}
	cout << "Posortowano tablice\n";
}

void wypisz_tablice(int* tab) {
	cout << "Tablica:\t";
	for (int i = 0; i < N; ++i) {
		cout << tab[i] << '\t';
	}
	cout << endl;
}

