class Solution{
  public:
    vector<int> duplicates(long long arr[], int n) {
        // code here
        vector<int> ans;
        sort(arr,arr+n);
        for(int i=0;i<n-1;i++)
        {
            if(arr[i]==arr[i+1])
            {
                if(ans.size()>=1)
                {
                    if(ans[ans.size()-1]!=arr[i])
                    {
                         ans.push_back(arr[i]);
                    }
                    
                }
                else
                {
                    ans.push_back(arr[i]);
                }
                
               
            }
        }
        if(ans.size()==0)
        {
            return {-1};
        }
        return ans;
    }
};


